import React, { useState } from 'react';
import { motion } from 'framer-motion';

const SupabaseTest = () => {
  const [connectionStatus, setConnectionStatus] = useState('Ready to test');
  const [error, setError] = useState(null);

  const testConnection = async () => {
    try {
      setConnectionStatus('Testing...');
      setError(null);
      
      // Import Supabase dynamically to avoid loading issues
      const { dbHelpers } = await import('../../config/supabase');
      
      // Test connection
      const { data: submissions, error: submissionsError } = await dbHelpers.getAllSubmissions();
      
      if (submissionsError) {
        throw submissionsError;
      }

      setConnectionStatus(`✅ Connected! Found ${submissions?.length || 0} submissions`);
    } catch (err) {
      setConnectionStatus('❌ Connection Failed');
      setError(err.message || 'Unknown error occurred');
      console.error('Supabase connection error:', err);
    }
  };

  const testCreateFarmer = async () => {
    try {
      setError(null);
      
      const { dbHelpers } = await import('../../config/supabase');
      
      const newFarmer = {
        phone_number: '9999999999',
        name: 'Test Farmer',
        location: 'Test Location',
        language: 'en'
      };

      const { error } = await dbHelpers.createFarmer(newFarmer);
      
      if (error) {
        throw error;
      }

      alert('✅ Test farmer created successfully!');
      testConnection(); // Refresh data
    } catch (err) {
      alert('❌ Error creating farmer: ' + err.message);
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-br from-green-50 to-blue-50 p-6">
      <div className="max-w-4xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          className="bg-white rounded-2xl shadow-xl p-8"
        >
          <h1 className="text-3xl font-bold text-gray-900 mb-6 text-center">
            🧪 Supabase Connection Test
          </h1>

          {/* Connection Status */}
          <div className="mb-8 p-6 bg-gray-50 rounded-xl">
            <h2 className="text-xl font-semibold mb-4">Connection Status</h2>
            <div className="text-2xl font-bold mb-2">{connectionStatus}</div>
            {error && (
              <div className="text-red-600 bg-red-50 p-4 rounded-lg">
                <strong>Error:</strong> {error}
              </div>
            )}
          </div>

          {/* Test Buttons */}
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4 mb-8">
            <button
              onClick={testConnection}
              className="bg-blue-600 text-white py-3 px-6 rounded-lg font-medium hover:bg-blue-700 transition-colors"
            >
              🔗 Test Connection
            </button>
            <button
              onClick={testCreateFarmer}
              className="bg-green-600 text-white py-3 px-6 rounded-lg font-medium hover:bg-green-700 transition-colors"
            >
              🧑‍🌾 Test Create Farmer
            </button>
          </div>

          {/* Instructions */}
          <div className="p-6 bg-yellow-50 rounded-xl">
            <h2 className="text-xl font-semibold mb-4">📋 How to Test</h2>
            <div className="space-y-2 text-sm">
              <div>1. Click "Test Connection" to check Supabase connection</div>
              <div>2. Look for "✅ Connected!" message</div>
              <div>3. Click "Test Create Farmer" to add test data</div>
              <div>4. Check your Supabase dashboard for new data</div>
            </div>
          </div>

          {/* Troubleshooting */}
          <div className="mt-6 p-6 bg-red-50 rounded-xl">
            <h2 className="text-xl font-semibold mb-4 text-red-800">🔧 Troubleshooting</h2>
            <div className="space-y-2 text-sm text-red-700">
              <div>• If you see "Connection Failed", check your Supabase URL and key</div>
              <div>• Make sure you've run the SQL schema in Supabase</div>
              <div>• Check browser console for detailed error messages</div>
              <div>• Verify your Supabase project is active</div>
            </div>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default SupabaseTest;
